import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();


    this.state = {
      //we are creating an array here
      monsters: [ 
        {
          name: 'Frankenstein',
          id: 'asr1'
        },
        {
          name: 'Dracula',
          id: 'asr1'
        },
        {
          name: 'Zombie'
        }
      ] 
    };
  }
  render() {
    return (
      <div className="App">
       {
         this.state.monsters.map(monster => <h1> { monster.name } </h1>)
       }
    </div>
    )
  }
}


export default App;
